import React from "react";
import campo from "./campo.css";
import {Cards} from "../cards"

function Campo({players}) {
  const divs = Array.from({length: players}, (_, index) => (
    <div key={index} className="campo-item">
      <div>
      <p>Div {index + 1}</p>
      <Cards/>
      </div>

    </div>
  ));
  return (
    <div className="campo">
      {divs}
    </div>
  );
}

export {Campo};
